use rodio::{Decoder, Sink, Source};
use std::fs::File;

async fn text_to_speech(text: &str) -> Result<String, Box<dyn std::error::Error>> {
    let client = Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<TextToSpeechResponse>()
        .await?;

    let file = File::create("audio.wav")?;
    let mut writer = std::io::BufWriter::new(file);
    writer.write_all(response.audio.as_bytes())?;

    Ok("audio.wav".to_string())
}

